import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom"; // Update import
import Navbar from "./navbar";

const Home = () => (
  <section id="home">
    <div>
      <p>DESIGNING</p>
      <h1>We Create Unique Architecture Design Ideas</h1>
      <button>Read More</button>
    </div>
  </section>
);

const Pages = () => (
  <section id="pages">
    <div style={color = "red"}>
      <h1>Pages Section</h1>
      <p>This is the Pages section of your website.</p>
    </div>
  </section>
);

const Portfolio = () => (
  <section id="portfolio">
    <div>
      <h1>Portfolio Section</h1>
      <p>This is the Portfolio section of your website.</p>
    </div>
  </section>
);

const Services = () => (
  <section id="services">
    <div>
      <h1>Services Section</h1>
      <p>This is the Services section of your website.</p>
    </div>
  </section>
);

const Blog = () => (
  <section id="blog">
    <div>
      <h1>Blog Section</h1>
      <p>This is the Blog section of your website.</p>
    </div>
  </section>
);

const ContactUs = () => (
  <section id="contact">
    <div>
      <h1>Contact Us Section</h1>
      <p>This is the Contact Us section of your website.</p>
    </div>
  </section>
);

const App = () => {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/pages" element={<Pages />} />
        <Route path="/portfolio" element={<Portfolio />} />
        <Route path="/services" element={<Services />} />
        <Route path="/blog" element={<Blog />} />
        <Route path="/contact" element={<ContactUs />} />
      </Routes>
    </Router>
  );
};

export default App;
